import axios from 'axios';

export const authenticatesSignup = async(data)=>{

    const URL = "http://locahost:8000";
    try{
            return await axios.post(`${URL}/signup,data`);
    }catch(error){
        console.log("Error while calling signup api",error)
    }
}
